INSERT INTO `helpedit` VALUES ('0','Dashboard','welcome','1','<font color=\"#000000\">Hello,</font> Welcome to<i> </i><font color=\"#000000\"><b>Deskera CRM</b>!</font>','Here are some quick tips to help you get started in less than a minute.','','crm.helpedit.0','crm.helpedit.title.0'),('1','Dashboard','tab-dashboard','1','This is your Dashboard','A workspace with effective sales tools to manage and monitor current information about your Leads, Contacts and Campaigns.','as__tabdashboard','crm.helpedit.1','crm.helpedit.title.1'),('10','Dashboard','help tips','1','Help Tips','If you need any help along the way, you will find it easily. Here are some suggestions:<ul style=\'padding-left:18px;\'><li type=\'disc\'>Unsure about how to use a button or link? Relax! Just point the mouse over it. Count one mississippi, two.. and a message explaining the button or link will appear. No need to search anywhere else!</li><li type=\'disc\'><a class=\'helplinks\' href=\'mailto:support@deskera.com\' target=\'_blank\'>Contact Deskera Support</a>. We are here to help you!</li><li type=\'disc\'>Find useful tricks and tips on the <a id=\'forum\' href=\'http://forum.deskera.com/\' target=\'_blank\' class=\'helplinks\'>Deskera Forum</a>. and the <a id=\'blog\' href=\'http://blog.deskera.com/\' target=\'_blank\' class=\'helplinks\'>Deskera Blog</a>.</li></ul>','','crm.helpedit.10','crm.helpedit.title.10'),('100','Key Accounts','graph','15','View Graphs','View reports through intuitive graphs. Renders a quick overview for the selected report.','chart15','crm.helpedit.100','crm.helpedit.title.100'),('101','Key Accounts','reports','15','View Reports','View Reports in a tabular view.','view15','crm.helpedit.101','crm.helpedit.title.101'),('102','Sales by Source','filter','16','Filter Reports','Select parameters such as dates to view reports for the selected time period.','filter16','crm.helpedit.102','crm.helpedit.title.102'),('103','Sales by Source','export','16','Export Sales by Source Lists in Convenient Formats','<ul style=\'padding-left:18px;\'><li type=\'disc\'>You can easily customize the Sales by Source list export format by defining templates.</li><li type=\'disc\'>Export in CSV and PDF formats.</li></ul>','export16','crm.helpedit.103','crm.helpedit.title.103'),('104','Sales by Source','quick search','16','Quick Search','Use quick search to search for specific key terms. Get search results as soon as you type.','quick16','crm.helpedit.104','crm.helpedit.title.104'),('105','Sales by Source','graph','16','View Graphs','View reports through intuitive graphs. Renders a quick overview for the selected report.','chart16','crm.helpedit.105','crm.helpedit.title.105'),('106','Sales by Source','report','16','View Reports','View Reports in a tabular view.','view16','crm.helpedit.106','crm.helpedit.title.106'),('107','Leads by Source','filter','17','Filter Reports','Select parameters such as dates to view reports for the selected time period.','filter17','crm.helpedit.107','crm.helpedit.title.107'),('108','Leads by Source','export','17','Export Leads by Source Lists in Convenient Formats','<ul style=\'padding-left:18px;\'><li type=\'disc\'>You can easily customize the Leads by Source list export format by defining templates.</li><li type=\'disc\'>Export in CSV and PDF formats.</li></ul>','export17','crm.helpedit.108','crm.helpedit.title.108'),('109','Leads by Source','quick search','17','Quick Search','Use quick search to search for specific key terms. Get search results as soon as you type.','quick17','crm.helpedit.109','crm.helpedit.title.109'),('11','Campaign','campaign details','2','Add Campaign Details','Adding, Updating and Navigating through the details here is as easy as using a spreadsheet. It allows you to add entries in a snap.','addnew10','crm.helpedit.11','crm.helpedit.title.11'),('110','Leads by Source','graph','17','View Graphs','View reports through intuitive graphs. Renders a quick overview for the selected report.','chart17','crm.helpedit