INSERT INTO `notification_definition` VALUES (1,1,4,'[#PARTNERNAME# CRM] New Opportunity assigned to you: #reftype1:oppname#','<html><head><title>#PARTNERNAME# - Opportunity</title></head><style type=\'text/css\'>a:link, a:visited, a:active {\ncolor: #03C;}\nbody {\nfont-family: Arial, Helvetica, sans-serif;color: #000;font-size: 13px;}</style><body><div><p>Hi <strong>#reftype1:oppmainowner.firstName# #reftype1:oppmainowner.lastName#</strong>,</p><p>The following opportunity has been assigned to you:</p><p>Opportunity : #reftype1:oppname#</p><p>Opportunity Stage :#reftype1:crmCombodataByOppstageid.value#</p><p>Opportunity Close Date : #reftype1:closingDate#</p><p>Account Name : #reftype1:crmAccount.accountname#</p><p>You can log in at:</p><p>#LOGINURL#</p><br/><p>See you on #PARTNERNAME#.</p><p> - #reftype2:firstName# #reftype2:lastName#</p></div></body></html>\n ',NULL,NULL),(2,1,3,'[#PARTNERNAME# CRM] New Opportunity is entered by #reftype2:firstName# #reftype2:lastName#','<html><head><title>#PARTNERNAME# - Opportunity</title></head><style type=\'text/css\'>a:link, a:visited, a:active {\ncolor: #03C;}\nbody {\nfont-family: Arial, Helvetica, sans-serif;color: #000;font-size: 13px;}</style><body><div><p>Hi <strong>$recipient:firstName$ $recipient:lastName$</strong>,</p><p>#reftype2:firstName# #reftype2:lastName# has entered a new opportunity with following description:</p><p>Opportunity Name: #reftype1:oppname#</p><p>Opportunity Stage: #reftype1:crmCombodataByOppstageid.value#</p><p>Opportunity Creation Date: #reftype1:createdon#</p><p>Opportunity Close Date: #reftype1:closingDate#</p><p>Account Name: #reftype1:crmAccount.accountname#</p><p>You can log in at:</p><p>#LOGINURL#</p><br/><p>See you on #PARTNERNAME#.</p></div></body></html>',NULL,NULL),(3,1,6,'[#PARTNERNAME# CRM] New Account assigned to you: #reftype1:accountname#','<html><head><title>#PARTNERNAME# - Account</title></head><style type=\'text/css\'>a:link, a:visited, a:active {\ncolor: #03C;}\nbody {\nfont-family: Arial, Helvetica, sans-serif;color: #000;font-size: 13px;}</style><body><div><p>Hi <strong>#reftype1:accountmainowner.firstName# #reftype1:accountmainowner.lastName#</strong>,</p><p>You have been assigned an account by #reftype2:firstName# #reftype2:lastName#:</p><p>Account Name: #reftype1:accountname#</p><p>You can log in at:</p><p>#LOGINURL#</p><br/><p>Thanks</p><p> - #reftype2:firstName# #reftype2:lastName#</p></div></body></html>',NULL,NULL),(4,1,10,'[#PARTNERNAME# CRM] New Task assigned to you','<html><head><title>#PARTNERNAME# - Task</title></head><style type=\'text/css\'>a:link, a:visited, a:active {\ncolor: #03C;}\nbody {\nfont-family: Arial, Helvetica, sans-serif;color: #000;font-size: 13px;}</style><body><div><p>Hi <strong>#reftype1:usersByUserid.firstName# #reftype1:usersByUserid.lastName#</strong>,</p><p>You have been assigned an activity by #reftype3:firstName# #reftype3:lastName#:</p><p>Description: #reftype1:flag# - #reftype1:subject#</p><p>Related To: [Account] #reftype2:accountname#<p>Status: #reftype1:crmCombodataByStatusid.value#</p><p>Start Date: #reftype1:startdate#</p><p>End Date: #reftype1:enddate#</p><p>You can log in at:</p><p>#LOGINURL#</p><br/><p>Thanks</p><p> - #reftype3:firstName# #reftype3:lastName#</p></div></body></html>',NULL,NULL),(5,1,9,'[#PARTNERNAME# CRM] New Task assigned to you','<html><head><title>#PARTNERNAME# - Task</title></head><style type=\'text/css\'>a:link, a:visited, a:active {\ncolor: #03C;}\nbody {\nfont-family: Arial, Helvetica, sans-serif;color: #000;font-size: 13px;}</style><body><div><p>Hi <strong>#reftype1:usersByUserid.firstName# #reftype1:usersByUserid.lastName#</strong>,</p><p>You have been assigned an activity by #reftype3:firstName# #reftype3:lastName#:</p><p>Description: #reftype1:flag# - #reftype1:subject#</p><p>Related To: [Lead] #reftype2:firstname# #reftype2:lastname#<p>Status: #reftype1:crmCombodataByStatusid.value#</p><p>Start Date: #reftype1:startdate#</p><p>End Date: #reftype1:enddate#</p>