e$ $recipient:lastName$</strong>,</p><p>Following web lead has been allocated to you:</p><p>Lead Name: #reftype1:firstname# #reftype1:lastname#</p><p>Email Address: #reftype1:email#</p><p>Phone Number: #reftype1:phone#</p><p>Please click on the link below to accept the lead</p><p><span width=\"275\" bgcolor=\"#f4f8fe\" style=\"border:0px solid #e7f0fe;font:bold 13px Arial, Helvetica, sans-serif;color:#5d6f8a;padding:10px;margin:0 auto\">Do you want to accept? <a target=\"_blank\" style=\"background:#5d6f8a;padding:5px;text-align:center;color:#fff !important;text-decoration:none;margin:0 5px\" href=\"#LOGINURL#?userid=$recipient:userID$&leadid=#reftype1:leadid#\">Yes</a></span></p><br/><p></p><p> - Thanks,</p><p>Administrator</p></div></body></html>',NULL,NULL),(14,1,18,'[#PARTNERNAME# CRM] New Accounts have been assigned to you','<html><head><title>#PARTNERNAME# - Account</title></head><style type=\'text/css\'>a:link, a:visited, a:active {color: #03C;}body {font-family: Arial, Helvetica, sans-serif;color: #000;font-size: 13px;}</style><body><div><p>Hi <strong>#reftype1:accountmainowner.firstName# #reftype1:accountmainowner.lastName#</strong>,</p><p>You have been assigned following accounts by #reftype2:firstName# #reftype2:lastName#:</p><p><table border=1><th>Sr.No.</th><th>Account Name</th><th>Account Type</th>VARIABLEDATA</table></p><p>You can log in at:</p><p>#LOGINURL#</p><br/><p>Thanks</p><p> - #reftype2:firstName# #reftype2:lastName#</p></div></body></html>',NULL,NULL),(15,1,19,'[#PARTNERNAME# CRM] New Opportunities have been assigned to you','<html><head><title>#PARTNERNAME# - Opportunity</title></head><style type=\'text/css\'>a:link, a:visited, a:active {color: #03C;}body {font-family: Arial, Helvetica, sans-serif;color: #000;font-size: 13px;}</style><body><div><p>Hi <strong>#reftype1:oppmainowner.firstName# #reftype1:oppmainowner.lastName#</strong>,</p><p>Following opportunities have been assigned to you:</p><table border=1><th>Sr.No.</th><th>Opportunity Name</th><th>Opportunity Stage</th><th>Opportunity Close Date</th><th>Account Name</th>VARIABLEDATA</table><p>You can log in at:</p><p>#LOGINURL#</p><br/><p>See you on #PARTNERNAME#.</p><p> - #reftype2:firstName# #reftype2:lastName#</p></div></body></html>',NULL,NULL);
